var ip = "localhost";

function api(param) {
	var http;
	if (window.XMLHttpRequest)  {
		http=new XMLHttpRequest();
	} else {
		http=new ActiveXObject("Microsoft.XMLHTTP");
	}
	var url = "http://"+ip+":5000/Remote/"+param;
	http.open("GET", url, true);
	http.send();
}

function isFullScreen() {
	api("goFullScreen");
}

